descriptionRu:
1) Эмаль ПФ-115 белая. Эффект/Блеск - глянцевый. Область применения - для внутренних и наружных работ. Стойкость к влаге - да. Материал обработки - штукатуренная поверхность. Фасовка - 20 кг./банка;
2) Водоэмульсионная краска для стен и потолков, протирающаяся класса Стандарт. Эффект/Блеск - Матовый. Область применения - Для внутренних работ. Вид - акриловая. Расход, г/м2 -167. Температура применения, С от +5 до +30. Тип растворителя - вода. Фасовка - 25 килограмм/ведро;
3) Шпатлевка гипсовая для окончательного выравнивания оштукатуренных и бетонных стен и потолков, исправления дефектов на бетоне, газобетоне, камне, для использования в помещениях с нормальной влажностью.
